import "./SidebarChannel.css";
function SidebarChannel() {
    return (
        <div className="sidebarChannel">
            <h4><span className="sidebarChannel__hash">#</span>Haldi</h4>
            <h4><span className="sidebarChannel__hash">#</span>Sangeet</h4>
            <h4><span className="sidebarChannel__hash">#</span>Sagai</h4>
            <h4><span className="sidebarChannel__hash">#</span>Vidai</h4>




        </div>
    )
}

export default SidebarChannel
